description:
Joe D'Amato's tale of love lost and paradise found. It's the story of a man, a woman, and a marriage on the rocks--until Cousin Julia and Charlie arrive, that is! Fresh from college and full of raging hormones, they and their friends turn Mickey's home into a sexual pep rally from flesh soaked orgies to anal cram sessions to deep oral lesbian lessons. It's an education in degradation and everyone passes these finals. Note: Antonella del Lago credited in the Sin City version but does not appear.

